INSERT INTO `blogs` VALUES (1,'The 5 Steps to start ecommerce success: what you need to know','Are you looking to expand your sources of income, start (finally) that project that you have had in mind in the last two years, or make a radical change in your life and be self-employed? By starting an e-commerce website you can do it!\n\nKeep reading!\n\nWe know it’s important to you to get off on the right foot, so we wrapped up the 5 steps you need to know if you are starting an online business: \n\n**1. Catchy business name**\nForget the stiff names. Sometimes, people are looking for magic and personality… And a catchy or funny business name can do the job for you. \n\n**2. Don\'t describe your business, tell them how you can help them**\nBesides your brand name, you want to create your tagline. How can you do that? Describe in a few words what can you do for your customers, it should be descriptive enough so that people know how you can help them.\n\nRemember, keep it short and simple!\n\n**3. Know your suppliers**\nCompetition is a good thing since it allows your niche to develop, so you want to be sure that your suppliers are giving you the best prices and quality. Do the research and look for testimonials and request trials before you launch a new product on your e-commerce website.  \n\n**4. Explore trends**\nWithout a doubt, your online business ideas are good, but there are tools that give you the assurance that the products you want to sell are in line with the buying trends of your target audience.\n\nGoogle Trends and Google Keyword Planner give you ideas to diversify your products according to current customer trends. \n\n**5. And last but not least, simplify recurring tasks**\nTaxes and permits payment dates can be easily forgotten, but keeping track of them on a simple tool as Google Calendar free mental space and allow you to focus on the growth strategy of your e-commerce website. \n\nAnd that’s all for now! \n\nWe hope these steps inspire you to start selling online.\n',1,'2020-10-20 23:05:26','2020-10-20 23:05:26'),(2,'The 5 Steps to start ecommerce success: what you need to know','Are you looking to expand your sources of income, start (finally) that project that you have had in mind in the last two years, or make a radical change in your life and be self-employed? By starting an e-commerce website you can do it!\n\nKeep reading!\n\nWe know it’s important to you to get off on the right foot, so we wrapped up the 5 steps you need to know if you are starting an online business: \n\n**1. Catchy business name**\nForget the stiff names. Sometimes, people are looking for magic and personality… And a catchy or funny business name can do the job for you. \n\n**2. Don\'t describe your business, tell them how you can help them**\nBesides your brand name, you want to create your tagline. How can you do that? Describe in a few words what can you do for your customers, it should be descriptive enough so that people know how you can help them.\n\nRemember, keep it short and simple!\n\n**3. Know your suppliers**\nCompetition is a good thing since it allows your niche to develop, so you want to be sure that your suppliers are giving you the best prices and quality. Do the research and look for testimonials and request trials before you launch a new product on your e-commerce website.  \n\n**4. Explore trends**\nWithout a doubt, your online business ideas are good, but there are tools that give you the assurance that the products you want to sell are in line with the buying trends of your target audience.\n\nGoogle Trends and Google Keyword Planner give you ideas to diversify your products according to current customer trends. \n\n**5. And last but not least, simplify recurring tasks**\nTaxes and permits payment dates can be easily forgotten, but keeping track of them on a simple tool as Google Calendar free mental space and allow you to focus on the growth strategy of your e-commerce website. \n\nAnd that’s all for now! \n\nWe hope these steps inspire you to start selling online.\n',2,'2020-10-24 00:09:11','2020-10-24 00:09:11'),(3,'Post de Prueba ','Hola mundo',2,'2020-10-24 00:09:38','2020-10-24 00:09:38');
